import React from "react";

import classes from "./MainHeader.module.css";
import logo from "../../images/keysee.png";

const MainHeader = () => {
  return (
    <header className={classes.header}>
      <nav>
        <img src={logo} alt="KeySee" className={classes.logoImg} />
        <ul>
          <li></li>
        </ul>
      </nav>
    </header>
  );
};

export default MainHeader;
